import React from "react";
import styles from "./WithSSR.module.css";
import viago from "./viago.gif";

export default function Viago() {
  return (
    <div className={styles.wrapper}>
      <h2>
        This component is loaded with the page dynamicly and its ssr friendly:
      </h2>
      <p>
        So you can check on source code (<strong>CTRL + U</strong>) for it,
        search for this entire sentence or even "Viago is gonna party" which is
        the image's alt
      </p>
      <div>
        <img height="250" width="300" alt="Viago is gonna party" src={viago} />
      </div>

      <p>
        You must import on this way:
        <pre className={styles.debug}>
          <code>
            const WithSSR = dynamic( 
              () => import("../components/WithSSR") 
            );
          </code>
        </pre>
      </p>
    </div>
  );
}
